import React from "react";
import "./style.css";

function Table({ data }) {
  return (
    <table>
      <thead>
        <tr>
          <th className="checkboxCell">
            <input type="checkbox" />{" "}
          </th>
          {Object.keys(data[0]).map((key) => (
            <th key={key}>{key}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {data.map((row, index) => (
          <tr key={index}>
            <td>
              {" "}
              <input type="checkbox" />{" "}
            </td>
            {Object.values(row).map((value, index) => (
              <td key={index}>{value}</td>
            ))}
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Table;
